import logo from './logo.svg';
import './App.css';
import MakingAnOrder from './MakingAnOrder';
import CreatingBouquetOne from './CreatingBouquetOne';
import CreatingBouquetTwo from './CreatingBouquetTwo';
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <MakingAnOrder/>
      <CreatingBouquetOne/>
      <CreatingBouquetTwo/>
      <CreatingBouquetOne number={49} color="pink" flower="peonies" />
      <CreatingBouquetTwo number={53} color="red" flower="roses" />
      </header>
    </div>
  );
}
export default App;
